script: |
  super -f text -I q11105.spq | sort > q11105.out

inputs:
  - name: q11105.spq
    data: |
      SELECT tab1.col0 FROM tab1 (FORMAT parquet) WHERE col1 * - col1 * + col1 NOT BETWEEN - col0 AND ( - col2 * + col2 );
  - name: tab1

outputs:
  - name: q11105.out
    data: |
      3
      64
      80
